// src/components/HeroVideo/HeroVideo.js
import React from 'react';

const HeroVideo = () => {
  return (
    <section className="relative w-full h-[80vh] overflow-hidden">
      <video autoPlay loop muted className="w-full h-full object-cover">
        <source src="/video.mp4" type="video/mp4" />
      </video>
      <div className="absolute inset-0 bg-black bg-opacity-60 flex flex-col justify-center items-center text-white p-4 text-center">
        <h2 className="text-4xl md:text-6xl font-bold mb-4">LinkClick</h2>
        <p className="text-lg md:text-2xl">We make the Internet easy for everyone.</p>
      </div>
    </section>
  );
};

export default HeroVideo;
